import React from 'react';
import '../carsandmini/CarsAndMini.css';
import morecar from '../../../../assets/more-racing.svg';

function MoreCars(){

    return(
        <div className='cam-wrapper'>
            <div className='cam-car-display'>      
                <div className='cam-car-option-wrapper'>
                    <div className='cam-car-option-image'><img src={morecar} alt=''></img></div>
                    <div className='cam-car-option-name'>name</div>
                    <div className='cam-car-option-price'>price</div>
                    <div className='cam-car-option-mpg'>est MPG</div>
                </div>
            </div>
        </div>
    )
}

export default MoreCars;
